import React from "react";
import "./ListCity.css";
import City from "../../data/city.json";

const ListCity = () => {
  return (
    <div className="ListCity">
      <div className="ListCityItem">
        {City.map((props, index) => (
          <ListCityItem
            key={index}
            name={props.name}
            image={props.image}
            subText={props.subText}
          />
        ))}
      </div>
    </div>
  )
};

export default ListCity;
